import React from 'react';
import './nav.css';

function Nav(props) {
  const linkList = props.value;
  const allLinks = linkList.map((link) =>
    <p class='nav-link'> {link.title.toString()} {console.log(link.add) }</p>


  );

  return (

    <div class="navbar">
        <ul class="nav">
          {allLinks}
        </ul>
      </div>
  );
}

export default Nav;
